.main-button {
  width: 160px;
  height: 40px;
  box-sizing: border-box;
  border: 1px solid $acent-color;
  border-radius: 25px;
  background-color: transparent;
  cursor: pointer;
  outline: none;


  @include font(600, 12px, 1.33);
  letter-spacing: 0.09em;
  text-transform: uppercase;
  color: $title-main-color;

  &:hover,
  &:focus {
    color: $title-secondary-color;
    background-color: $acent-color;
  }

  &--dark {
    color: $title-secondary-color;
  }
}
